import React from 'react';
import './inputtag.css';

const Inputtag = ({ label, placeholder, type, required = true }) => {
  return (
    <div className='input_box'>
      <label>{label}</label>
      <input type={type} placeholder={placeholder} required={required} />
    </div>
  );
};

export default Inputtag;
